description:
This client library is a powerful tool for Azure Search services. This tool allows to easy upload/search/delete to search service with using only one line of code.

Samples - https://github.com/tomaszmargacz/nuget-samples/tree/master/Azure.Search.Quick.Sample 

If you have any questions or need improvement feel free to contact me: tomasz.margacz@gmail.com

Sample code:
// init
var azureSearchQuick = new AzureSearchQuick(„* URL *”,”* KEY *”);

//search
var searchResult = azureSearchQuick.Search<SearchModel>("?search=Azure Search Quick");

// prepare
Dictionary<string, object> temp = new Dictionary<string, object>();
temp.Add("Key", "ValueTest");
temp.Add("Name", "Azure Search Quick");

// mergeOrUpload
var mergeOrUploadResult = azureSearchQuick.MergeOrUpload(temp);

// delete
var deleteResult = azureSearchQuick.Delete("Key", "ValueTest");

